import { Link } from 'react-router-dom'

const Register = () => {
  const [inputs,setInputs] = useState({
    username: "",
    email:"",
    password:"",
  });

  const handleChange = e =>{
    setInputs()
  }


  return (
    <div className="auth">
    <h1>Register</h1>
    <form>
        <input required type="text" placeholder='username' onChange={handleChange}/>
        <input required type="email" placeholder='email' onChange={handleChange}/>
        <input required type="password" name="" id="" placeholder='password' onChange={handleChange}/>
        <button>Register</button>
        <p>this is error</p>
        <span>Do you have an account ? <Link to="/login">Login</Link></span>
    </form>
    </div>
  )
}

export default Register
